export default function PokemonCard({ key, name }) {
  return (
    <article className='PokemonCard'>
      <p>id: {key}</p>
      <p>name: {name && name != null && name !== undefined ? name
        : "unknown"}</p>
      <button>Catch</button>
    </article>
  )
}
